import './App.css';
import Navbar from './Navbar'
import SearchView from './SearchView'
import AboutView from './AboutView'
import { Switch, Route } from 'react-router-dom'


function App() {
  return (
    <div>
      <Navbar/>
      <Switch>
        <Route path="/"exact>
          <SearchView/>
        </Route>
        <Route path="/about" component={AboutView}/>
        <Route path="/search">
          <SearchView />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
